import { Container, Nav, Navbar, NavDropdown, Button } from 'react-bootstrap';
import bloodNavbar from '../assets/images/bloodNavbar.png';
import './Navbar.css';

function NavigationBar() {
  return (
    <Navbar bg="white" expand="lg" className="py-3">
      <Container>
        <Navbar.Brand href="/">
            <img 
              src={bloodNavbar}
              alt="Gota de sangue"
              className="img-fluid"
              style={{ 
                maxWidth: '50px',
                filter: 'brightness(2) contrast(1.5) saturate(1.2)'
              }}
            />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link href="/" className="mx-2" active>Home</Nav.Link>
            <Nav.Link href="/sobre" className="mx-2">Sobre n√≥s</Nav.Link>
            <Nav.Link href="/encontrar" className="mx-2">Encontrar Sangue</Nav.Link>
            <NavDropdown title="Cadastre-se" id="basic-nav-dropdown" className="mx-2">
              <NavDropdown.Item href="/cadastro/doador">Como Doador</NavDropdown.Item>
              <NavDropdown.Item href="/cadastro/banco">Como Banco de Sangue</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Button variant="outline-dark" href="/login" className="px-4">Entrar</Button>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationBar;
